@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

atm:BadPassword a owl:Class .
atm:BadBankCode a owl:Class .
atm:BadAccount a owl:Class .
atm:CardEjected a owl:Class .
atm:ErrorMessageDisplayed a owl:Class .

atm:Authorization a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:receives ;
        owl:someValuesFrom [
            owl:unionOf (atm:BadPassword atm:BadBankCode atm:BadAccount)
        ]
    ] .

atm:CardEjected a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:isResultOf ;
        owl:someValuesFrom atm:Authorization
    ] .

atm:ErrorMessageDisplayed a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:isResultOf ;
        owl:someValuesFrom atm:Authorization
    ] .
